public Object packetColored(boolean far, Location loc,
                                Color color) {
        return packet(far,
                loc.getX(),             loc.getY(),                 loc.getZ(),
                color.getRed() / 255D,  color.getGreen() / 255D,    color.getBlue() / 255D,
                1D, 0);
    }
